INSERT INTO "biomasschp_constant" VALUES ('200', 'fuel_ST', 's_fuel_reserve_days', '燃料的储备日数', 'Tdc', 'd', '推荐值为7~8', '目前，国内生物质电厂的燃料一般以各收购点厂外破碎为主，厂内一般不设破碎设备。电子汽车衡配备的数量一般为2台，1台计量进厂重车，1台计量出厂空车，吨位多在50~100t。厂内原料堆场的主要作用是对入厂燃料进行暂存及翻晒，按布置形式可分为露天堆场和半露天堆场，北方地区由于少雨，一般多采用露天堆场，南方地区由于多雨，一般多采用半露天堆场，需设置遮雨棚；按功能作用又可分为常用堆场和备用堆场。（1）配置1台装载机及2台液压叠臂式抓斗起重机，用于燃料的堆卸料及转运工作；（2）原料堆场内的转运及堆高设备由用户根据电厂实际运行情况采购。', '8', '');
INSERT INTO "biomasschp_constant" VALUES ('201', 'fuel_ST', 's_fuel_available_reserves', '燃料可存储量', 'Bdc', 't', 'Qd*T', '', '', 'T');
INSERT INTO "biomasschp_constant" VALUES ('202', 'fuel_ST', 's_aggregate_coefficient', '计算堆料系数', 'Ndc', '--', '考虑到消防及汽车通道', '', '0.65', '');
INSERT INTO "biomasschp_constant" VALUES ('203', 'fuel_ST', 's_average_stack_height', '平均堆高', 'Hdc', 'm', '推荐值为4~6', '', '5', '');
INSERT INTO "biomasschp_constant" VALUES ('204', 'fuel_ST', 's_fuel_bulk_density', '燃料堆积密度', 'p', 't/m³', '推荐值取0.04~0.1，在无资料情况下 原始设定值取0.04', '', '', 'T');
INSERT INTO "biomasschp_constant" VALUES ('205', 'fuel_ST', 's_yardarea', '原料堆场面积', 'Fdc', '㎡', 'Bdc/(p*Hdc*Ndc)', '', '', 'T');
INSERT INTO "biomasschp_constant" VALUES ('206', 'fuel_ST', 'd_fuel_reserve_days', '燃料的储备日数', 'Tlp', 'd', '推荐值为4~8', '干料棚的主要作用是储存符合入炉要求的燃料，兼具卸载、转运、拌料、上料、整备等功能，一般采用半封闭式结构，设消防措施，不设采暖措施。（1）对于一炉一机配置的生物质电厂，干料棚内一般设置2台液压叠臂式抓斗起重机，每台起重量10t，斗容3m³，也可配置2台内燃叉车或2台轮式装载机，另设1台备用；（2）对于两炉两机配置的生物质电厂，干料棚内一般设置4台液压叠臂式抓斗起重机，每台起重量5t，斗容1.5m³，并辅以装载机及内燃叉车。', '7', '');
